import styled from "styled-components"
import Icons from "../icons"
import Burguer from "../menuBurger";

const HeaderContainer = styled.header`
    display: flex;
    justify-content: space-around;
    width: 100vw;
    height: 50px;
    background: linear-gradient(65deg, #00652e 35%, #00652ee1);
    align-items: center;
    color: #fff;
`;

const Header = () => {
    return(
        <>
        <Burguer />
        <HeaderContainer>
            <Icons />
        </HeaderContainer>
        </>
    )
}
export default Header;
